    }

    async postHeader(header) {
        return fetch('/api/header', {
            method: 'POST',
            body: JSON.stringify(header)
        }).then(res => {
            if (res.status == 500) {
                throw new Error();
            }
            else {
                return res.json()
            }
        } 

        ).then(res=> 
            res
        )
    }

    async putHeader(header) {
        let newHeader = {...header, id: 1}
        return fetch('/api/header', {
            method: 'PUT',
            body: JSON.stringify(newHeader)
        }).then(res => {
            if (res.status == 500) {
                throw new Error();
            }
            else {
                return res.json()
            }
        } 

        ).then(res=> 
            res
        )
    }

    async save(header) {
        try {
            //if a header is returned, then call the put to update the header
            await this.getHeader()

            let returnedHeader = await this.putHeader(header)
            console.log(returnedHeader)

        }
        catch (error) {
            //if a header is not returned, then call the post to create the header
            let returnedHeader = await this.postHeader(header)
            console.log(returnedHeader)
        }
    }
}
